    }
    function singKleLayer(map, url) {
      // 获取凤羽图的配置参数
      const params = getsingleKConfig()
      // 获取文本配置参数
      const paramstext = getTextCogtig()
      // 获取箭头配置参数
      //  const paramsArrow=getArrowCogtig();
      tiffLayers = new blendLayers(map, {
        url: url,
        metadata: {
          scale: 1, // 缩放比例
          offset: 0, //偏移量
        },
      })
      //绘制色斑图
      tiffLayers._render(params).then((object) => {
        tiffLayers.addCogeoLayer(params).then((layer) => {
          map.addLayer(layer)
        })
        // // //绘制网格值
        tiffLayers.addTextLayer(paramstext).then((layer) => {
          let option = {
            gridLayer: {
              range: {
                min: 10,
                max: 20,
              },
            },
          }
          map.addLayer(layer)
        })
      })
    }

    function getsingleKConfig() {
      let params = {
        layerName: 'cogtifLayer',
        opacity: 0.8,
        interpolation: 'nearest', // 渐变 linear  区间 nearest  网格 grid
        zIndex: 14,
        colors: [
          [0, [173, 85, 56, 1]],
          [30, [173, 110, 56, 1]],
          [40, [173, 146, 56, 1]],
          [50, [105, 173, 56, 1]],
          [60, [56, 173, 121, 1]],
          [70, [56, 174, 173, 1]],
          [75, [56, 160, 173, 1]],
          [80, [56, 157, 173, 1]],
          [83, [56, 148, 173, 1]],
          [87, [56, 135, 173, 1]],
          [90, [56, 132, 173, 1]],
          [93, [56, 123, 173, 1]],
          [97, [56, 98, 157, 1]],
          [100, [56, 70, 114, 1]],
        ],
      }
      return params
    }

    function getTextCogtig() {
      let params = {
        layerName: 'textLayer',
        type: 'grid',
        layerName: 'textLayer', //文本图层的图层名字,默认是栅格数据id名称加上_Text
        precision: 1, //格网数据显示的小数点的精度
        opacity: 1, //透明度
        zIndex: 200, //图层层级
        distanceArrow: 80, //距离
        textStyle: {
          //   //文本样式
          Style: {
            text: {
              Text: {
                font: '18px Calibri,sans-serif',
                fill: {
                  Fill: {
                    color: '#ff0000',
                  },
                },
                stroke: {
                  Stroke: {
                    color: '#ffffff',
                    width: 4,
                  },
                },
              },
            },
          },
        },
      }

      return params
    }
  </script>
